# import Flask, render_templatefrom flask import Flask, render_template# Import Dependenciesfrom sqlalchemy import create_engineengine = create_engine("postgres://postgres:password@localhost:5432/Project-2-Yelp")data = []for record in engine.execute("SELECT * FROM yelp_cities"):    entry = {                'id':record.id,                'name':record.name,                'review_count':record.review_count,                'location': record.location,                'category': record.category,                'rating': record.rating,                'price':record.price,                'latitude':record.latitude,                'longitude':record.longitude,                'is_closed':record.is_closed,            }        data.append(entry)print(data)app = Flask(__name__)@app.route('/')def entry():    return render_template('index.html', data = data)if __name__ == "__main__":    app.run()